				"La Carta Regionale dei Servizi (di seguito CRS), è una smartcard distribuita da Regione Lombardia, conforme allo standard CNS (Carta Nazionale dei Servizi). La CRS è una tessera elettronica contenente una chiave privata che garantisce il riconoscimento dell’identità dell’utilizzatore. Per questo tipo di autenticazione Regione Lombardia utilizza e mette a disposizione degli EELL il servizio Identity Provider Cittadinia (nel seguito IdPC). Il dataset Accessi CRS contiene l'elenco di tutte le operazioni di autenticazione effettuate tramite IdPC con CRS o con altre Carte Nazionali dei Servizi emesse dalla Pubblica Amministrazione. Per una lista esaustiva delle funzionalità si consulti il sito di progetto http://www.crs.lombardia.it", "Government", "crs, cns, idpc",
