				"Bacini Idrografici 10000mq",
				"Lo shape file dei Bacini Idrografici 10000mq è contenuto nel gruppo della banca dati dei Bacini Idrografici in scala 1:10.000. La Banca Dati Bacini Idrografici contiene lo strato informativo dei bacini idrografici delle aree montuose alpine, prealpine ed appenniniche (Oltrepo Pavese) della Regione. Il territorio è suddiviso in bacini elementari con due valori di superficie: 30 ettari e 10 chilometri quadrati. Contiene inoltre le linee di impluvio di ogni bacino. Per ogni bacino sono stati calcolati parametri idromorfologici relativi a: superficie, perimetro, lunghezza, quote, pendenza, esposizione, ecc.... Per maggiori dettagli cliccare sul link \"Dettaglio metadati\". Per una visione di insieme dei livelli informativi contenuti cliccare sul link \"viewer geografico\". Dall'interno del Viewer geografico è anche possibile importare lo shape file scaricato.",
